import React from 'react';

const CompPopup = ({_setShow}) => {

  function fnClosePopupHandler () {
    _setShow(false)
  }
  return (
    <div className='popup'>
      <h2>팝업창</h2>
      <p><input type="checkbox" />
       오늘 하루 창 열지 않기</p>
       <button onClick={fnClosePopupHandler}>닫기</button>
    </div>
  );
};

export default CompPopup;
